import { Box, Divider, Grid, Typography } from "@mui/material";
import Paper from "@mui/material/Paper";
import CheckIcon from "@mui/icons-material/Check";
import React from "react";
import Button from "@mui/material/Button/Button";

const PriceSection: React.FC = () => {
  return (
    <React.Fragment>
      <Grid
        container
        sx={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          padding: "1rem",
        }}
      >
        <Grid item xs={12} sm={4}>
          <Paper
            elevation={4}
            sx={{
              //   display: "flex",
              //   flexDirection: "column",
              //   justifyContent: "center",
              background: "linear-gradient(to bottom, #ffc83d, #DAA520)",
            }}
          >
            <Box
              sx={{
                display: "flex",
                flexDirection: "column",
                justifyContent: "center",
                alignItems: "center",
                bgcolor: "#fff",
                padding: "1rem",
              }}
            >
              <Typography variant="h6" mb={1}>
                BASIC
              </Typography>
              <Divider
                sx={{
                  width: "20%",
                  height: ".2rem",
                  backgroundColor: "#DAA520",
                  color: "#DAA520",
                  marginBottom: 2,
                }}
              />
              <Typography variant="body2" textAlign={"center"} mb={1}>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit.
              </Typography>
              <Typography variant="h6" color={"secondary"} mb={1}>
                R$ 29,90/Mês
              </Typography>
            </Box>
            <Box
              sx={{
                padding: "1.5rem 0",
                display: "flex",
                justifyContent: "center",
              }}
            >
              <Box
                sx={{
                  display: "flex",
                  justifyContent: "center",
                  marginTop: "1rem",
                }}
              >
                <CheckIcon sx={{ color: "#fff" }} />
                <Typography variant="body2" color={"#fff"}>
                  Lorem ipsum dolor
                </Typography>
              </Box>
              <Box
                sx={{
                  display: "flex",
                  justifyContent: "center",
                  marginTop: "1rem",
                }}
              >
                <CheckIcon sx={{ color: "#fff" }} />
                <Typography variant="body2" color={"#fff"}>
                  Lorem ipsum dolor
                </Typography>
              </Box>
              <Box
                sx={{
                  display: "flex",
                  justifyContent: "center",
                  marginTop: "1rem",
                }}
              >
                <CheckIcon sx={{ color: "#fff" }} />
                <Typography variant="body2" color={"#fff"}>
                  Lorem ipsum dolor
                </Typography>
              </Box>
              <Box
                sx={{
                  display: "flex",
                  justifyContent: "center",
                  marginTop: "1rem",
                }}
              >
                <CheckIcon sx={{ color: "#fff" }} />
                <Typography variant="body2" color={"#fff"}>
                  Lorem ipsum dolor
                </Typography>
              </Box>
              <Box
                sx={{
                  display: "flex",
                  justifyContent: "center",
                  marginTop: "1rem",
                }}
              >
                <CheckIcon sx={{ color: "#fff" }} />
                <Typography variant="body2" color={"#fff"}>
                  Lorem ipsum dolor
                </Typography>
              </Box>
              <Button
                variant="text"
                sx={{
                  bgcolor: "#fff",
                  color: "#DAA520",
                  //     :hover{
                  //     color: "#fff",
                  //     }
                }}
              >
                Assinar
              </Button>
            </Box>
            <Box>text</Box>
          </Paper>
        </Grid>
        <Grid item xs={12} sm={4}></Grid>
        <Grid item xs={12} sm={4}></Grid>
      </Grid>
    </React.Fragment>
  );
};

export default PriceSection;
